import React from "react";
import styled from "styled-components";

const StyledButton = styled.button`
  width: 271px;
  height: 38px;

  background-color: ${props => props.colorBackground || "palevioletred"};
  border: none;
  border-radius: 109px;
`;
export function Button(props) {
  return <StyledButton type={props.type} colorBackground>{props.value}</StyledButton>;
}
